class AProject {
  contructor(name, desc, github, img){
    this.name = name;
    this.desc = desc;
    this.github = github;
    this.img = img;
  }
}

class MyProjectList {
  constructor(){
    this.list = [];

    this.list.push(
        AProject('example', 'example1', 'https://github.com', './imgs/star_background.jpg')
    );

    this.list.push(
        AProject('example2', 'example3', 'https://github.com', './imgs/star_background.jpg')
    );

    this.list.push(
        AProject('example2', 'example3', 'https://github.com', './imgs/leaf_background.jpg')
    );
  }
}

export default ProjectList;
